        <template #title>
            <span class="h2">Create new Book</span>
        </template>

        <template #content>
            <input type="text" class="input-default" v-model="form.name">

            <jet-input-error :message="form.error" class="mt-2" />
        </template>

        <template #footer>
            <button @click="createBook()">Test</button>
        </template>
    </jet-dialog-modal>
